import { Dimensions } from "react-native";

function Viewport() {
    const vw = Dimensions.get("windows").width;
    const vh = Dimensions.get("windows").width;
    const vmin = (vw < vh) ? vw : vh;
    const vmax = (vw > vh) ? vw : vh;
    return (vw, vh, vmin, vmax);
}

